def proposition_99_study_test(sample_data):
    """
    Testing the model on the proposition 99 study

    """
    synth = sc.SyntheticControl(
        data=sample_data,
        unit_col="state",
        time_col="year",
        value_col="cigsale",
        treated_unit="California",
        experiment_date=1988,
        covariates=["retprice"],
    )

    synth.fit(calculate_se=False)

    assert np.isclose(np.mean(synth.weights.values), 0.026316)
    assert np.isclose(np.max(synth.weights.values), 0.432629)
    assert np.isclose(np.min(synth.weights.values), 0.0)
    assert np.isclose(np.median(synth.weights.values), 8.881438853501265e-15)
    assert np.isclose(np.std(synth.weights.values), 0.0816086593196616)


def test_filter_donor_units_no_matching_units():
    data = {"UNITS": ["A", "A", "B", "B", "C", "C", "C"], "TIME": [1, 2, 1, 2, 1, 2, 3], "VAR": [10, 20, 10, 20, 10, 20, 30]}
    df = pd.DataFrame(data)
    treatment_unit = "C"
    unit_col = "UNITS"

    filtered_df = sc.filter_donor_units(df, treatment_unit, unit_col)

    expected_units = ["C"]
    assert set(filtered_df[unit_col].unique()) == set(expected_units)


def test_filter_donor_units_all_units_match():
    data = {"UNITS": ["A", "A", "B", "B", "C", "C"], "TIME": [1, 2, 1, 2, 1, 2], "VAR": [10, 20, 10, 20, 10, 20]}
    df = pd.DataFrame(data)
    treatment_unit = "A"
    unit_col = "UNITS"

    filtered_df = sc.filter_donor_units(df, treatment_unit, unit_col)

    expected_units = ["A", "B", "C"]
    assert set(filtered_df[unit_col].unique()) == set(expected_units)


def test_filter_donor_units_single_unit():
    data = {"UNITS": ["A", "A"], "TIME": [1, 2], "VAR": [10, 20]}
    df = pd.DataFrame(data)
    treatment_unit = "A"
    unit_col = "UNITS"

    filtered_df = sc.filter_donor_units(df, treatment_unit, unit_col)

    expected_units = ["A"]
    assert set(filtered_df[unit_col].unique()) == set(expected_units)


def test_collect_series_to_dataframe():
    series1 = pd.Series([1, 2, 3], name="series1")
    series2 = pd.Series([4, 5, 6], name="series2")
    series_list = [series1, series2]

    df = sc.collect_series_to_dataframe(series_list)

    assert isinstance(df, pd.DataFrame)
    assert list(df.columns) == ["series1", "series2"]
    assert df.shape == (3, 2)
    assert df["series1"].tolist() == [1, 2, 3]
    assert df["series2"].tolist() == [4, 5, 6]


def test_get_good_fit_units():
    data = {"unit1": [0.1, 0.2, 0.3, 0.4], "unit2": [0.5, 0.6, 0.7, 0.8], "unit3": [0.9, 1.0, 1.1, 1.2]}
    index = [datetime(2020, 1, 1), datetime(2020, 1, 2), datetime(2020, 1, 3), datetime(2020, 1, 4)]
    effects = pd.DataFrame(data, index=index)
    index_threshold = datetime(2020, 1, 3)
    tolerance_pct = 50

    good_fit_units = sc.get_good_fit_units(effects, index_threshold, tolerance_pct)

    assert isinstance(good_fit_units, pd.Index)
    assert "unit1" in good_fit_units
    assert "unit2" not in good_fit_units
    assert "unit3" not in good_fit_units


